import React from 'react';

const SeekerReg = () => {
    return (
        <div>
            {/* Banner */}
            <section id="banner">
                <h1 style={{fontWeight: 525}}>About Us</h1>
                <p style={{fontSize: 'x-large', fontWeight: 325}}>Our sole mission is to help save lives affected by Covid-19</p>
            </section>

            
        </div>
    );
};

export default SeekerReg;
